      content: "Студент к врачу приходит и жалуется. \n— Четыре дня не хожу в туалет, наверное, у меня запор, помогите доктор. \nВрач его осмотрел, достал из кармана кошелёк и, протягивая деньги студенту, говорит:\n — Сходи, поешь. \n-----------------------------------------------------------------------------------\n— Папа, а почему кошки могут видеть в темноте? \n— Потому что до выключателя не достают! \n-----------------------------------------------------------------------------------\nОдесса. Привоз. Колбасный ряд. \n— Мужчина! Шо вы ото целый час ходите, пробуете и ничего не берёте?! Вам шо, таки ничего не нравится? \n— Нравится! \n— Шо, денег нет?! \n— Есть! \n— Ну так покупайте! \n— Зачем? \n— Так шобы кушать!\n--- А я шо делаю?\n------------------------------------------------------------------------------------\nХоронят олигарха. Гроб стоит. Собрались друзья. \n   Подходит к покойному Гусинский, достает портмоне, извлекает 200 долларов, кладет в гроб и скорбно отходит.     \n   За Гусинским к гробу подходит Потанин, тоже достает портмоне, отсчитывает 200 долларов, кладет, отходит. \n   Наконец, подбегает Березовский. Достает чековую книжку, выписывает чек на 600 долларов, кладе, забирает 400 баксов наличными, отходит. "
